import React, { useState } from "react";

const SearchBox = (props) => {
    const [value, setvalue] = useState("")
    return (
        <>
            <input
                className="inputStyle"
                type="text"
                placeholder="Search for images here..."
                value= {value}
                onChange={props.userSubmit}
            />
        </>
    )
}

export default SearchBox;
